import { Avatar, Card } from 'antd';

const UserProfile = () => {
    return(
        <Card
            actions={[
                <div key="writeNum"></div>
            ]}
        >
            <Card.Meta>
                avatar={<Avatar>MSG</Avatar>}
                title="test"
            </Card.Meta>
        </Card>
    )
}

export default UserProfile;
